{"focus": {"food": false, "audit": false, "labor": false, "water": false, "ethics": false, "social": {"labor": false, "other": {}, "community": false, "diversity": false, "education": false, "human_rights": false, "financing_risk": false, "product_safety": false, "access_to_finance": false, "affordable_housing": false, "health_and_medicine": false, "access_to_technology": false, "supply_chain_management": false, "privacy_and_data_security": false}, "community": false, "education": false, "recycling": false, "governance": {"audit": false, "other": {}, "ethics": false, "compensation": false, "impact_oversight": false, "board_composition": false, "impact_disclosure": false, "shareholder_rights": false, "tax_responsibility": false}, "green_tech": false, "waste_mgmt": false, "natural_gas": false, "biodiversity": false, "compensation": false, "human_rights": false, "environmental": {"food": false, "other": {}, "water": false, "recycling": false, "green_tech": false, "biodiversity": false, "toxic_substance": false, "waste_management": false, "energy_efficiency": false, "land_conservation": false, "climate_related_disruption": false, "sustainable_infrastructure": false, "environmental_financing_risk": false}, "product_safety": false, "impact_oversight": false, "toxic_substances": false, "access_to_finance": false, "board_composition": false, "energy_efficiency": false, "impact_disclosure": false, "land_conservation": false, "supply_chain_mgmt": false, "affordable_housing": false, "shareholder_rights": false, "tax_responsibility": false, "health_and_medicine": false, "access_to_technology": false, "social_financing_risk": false, "diversity_and_empowerment": false, "privacy_and_data_security": false, "sustainable_infrastructure": false, "business_disruption_and_climate": false}, "factor": {"overview": "The research process is focused on identifying important climate change segments and the most attractive businesses within them. Analysts seek companies that generate the majority of their revenue from climate change solutions and adaptations and, therefore, consider positive environmental impact the most. The team does not apply a specific ESG framework to the research process, but they integrate ESG considerations in the research process primarily as a way to identify risks. 

The research the team originally engaged in at the inception of the Resources Fund in 2011 has led directly to this Climate Change strategy. Within the Resources Fund the team was already excluding carbon, coal and Tar sands, as well as other offensive emissions products like kerogen oil. They also have a smaller energy approach compared to peers35% energy compared to 70% cap-weighted approachand have targeted alternative energy.

The Funds investment thesis is based on the conviction that climate change solutions are not only key to address environmental challenges, but that the economics will favor businesses over traditional ones. According to them, climate change may be the most important issue facing investors in the coming decades. As such, ESG and impact factors are central to the strategy and actively monitored."}, "is_impact": {"value": true}, "reporting": {"portfolio": {"value": "false"}}, "engagement": {"monitor_report": "They do not evaluate the efficacy of this engagement or provide updates on the outcomes to investors."}, "exclusions": {"oil": false, "coal": false, "alcohol": false, "defense": false, "tobacco": false, "weapons": false, "gambling": false, "natural_gas": false, "abortifacients": false, "contraceptives": false, "stem_cell_research": false, "adult_entertainment": false}, "philosophy": "Jeremy Grantham is passionate about and has been writing about climate change, renewables and finite resources for close to a decade. He and the Focused Equity team conceived of this strategy together after intensively studying market trends and drivers.", "controversy": {"evaluation": "The Fund does not have a policy to deal with controversies. The Fund needs to be pragmatic in order to manage 150 positions. Of the companies in the viable universe, those that the team considers questionable in regards to ESG standards, they will monitor closely. They develop internal write-ups that identify risks and concerns and present the con case. They also directly engage with companies to discuss their concerns and provide recommendations and guidance on how to improve."}, "proxy_voting": {"policy": "GMO does not typically conduct its own research, but has engaged Institutional Shareholder Services Group, Inc. (ISS) as its proxy voting agent to research and make voting recommendations or, for matters for which GMO has so delegated, to make the voting determinations; ensure that proxies are voted and submitted in a timely manner; maintain records of proxy statements received in connection with proxy votes and provide copies of such proxy statements promptly upon request; maintain records of votes cast; and provide recommendations with respect to proxy voting matters in general.", "is_utilized": true}, "considerations": {"decision_making_process": "The Fund is laser focused on investing in business models that truly combat climate change and its effects. The teams investment process is very aligned with this goal and is thorough and robust."}, "direct_engagement": {"method": "The Fund engages with some portfolio companies, particularly those that are considered questionable. The Fund raises its concerns directly with management and provide recommendations for solutions. The investment team is  pragmatic as they need to monitor 150 positions and only engage with companies when needed. The team may engage companies before or after the allocation is made."}, "business_quality_governance": {"overview": "The GMO Climate Change Fund seeks to deliver high total return by investing globally in companies focused on climate change mitigation and adaptation. Climate change mitigation and adaptation industries include clean energy, batteries and storage, electric grid, energy efficiency, agriculture, water, and companies that service these industries."}, "performance_risk_manangement_effect": "The Fund expects to generate market rate returns and uses the same investment processes and risk management approach as its Resource Fund."}
